import "./styles.css";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
} from "react-router-dom"
import Home from "./components/Home";
import About from "./components/About";


export default function App() {
    //state

    //comportements

    //affichage
    return (
        <div className="App">
            <Router>
                <div>
                    <Routes>
                        <nav>
                            <ul>
                                <li>
                                    <Link to="/">Home</Link>
                                    <Link to="/about">About</Link>
                                </li>
                            </ul>
                        </nav>

                        <Route path="/">
                            <Home/>
                        </Route>
                        <Route path="/about">
                            <About/>
                        </Route>
                    </Routes>
                </div>
            </Router>
        </div>
    );
}
